import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { TextField, Button, Typography, Box } from '@mui/material';

function UserLogin() {
  const [userID, setUserID] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  const handleLogin = () => {
    // Dummy logic, replace with real check
    if (password === 'user123') {
      navigate('/quiz');
    } else {
      alert('Invalid credentials');
    }
  };

  return (
    <Box sx={{ textAlign: 'center', mt: 10 }}>
      <Typography variant="h4">User Login</Typography>
      <TextField label="User ID" value={userID} onChange={(e) => setUserID(e.target.value)} sx={{ m: 1 }} />
      <TextField label="Password" type="password" value={password} onChange={(e) => setPassword(e.target.value)} sx={{ m: 1 }} />
      <br />
      <Button variant="contained" onClick={handleLogin}>Login</Button>
    </Box>
  );
}

export default UserLogin;
